import React from 'react';

const Bold = () => {
  return (
    <svg width="9" height="10" xmlns="http://www.w3.org/2000/svg">
      <text
        transform="translate(-12 -10)"
        fill="#333740"
        fillRule="evenodd"
        fontSize="13"
        fontFamily="Baskerville-SemiBold, Baskerville"
        fontWeight="500"
      >
        <tspan x="12" y="20">
          B
        </tspan>
      </text>
    </svg>
  );
};

export default Bold;
